import './FilterByYear.css';
import Card from '../UI/Card';
function FilterByYear(props) {
  let yearArray = props.years;
  let items = [];
  for (let i = 0; i < yearArray.length; i++) {
    items.push(<option value={yearArray[i].toString()} key={yearArray[i].toString()}>{yearArray[i]}</option>)
  }
  return (
    < Card className='top-widget' >
      <p>Filter By Year</p>
      <select name="year" id="years">
        {items}
      </select>
    </Card >
  )
}
export default FilterByYear;
